import React from 'react';


export default class Footer extends React.Component {

    render() {
        return (
            <div className="container">
                <div className="col-xl-4"></div>
                <div className="col-xl-4">
                    <p>Informacje o autorze strony znajdują się tutaj.</p>
                </div>
                <div className="col-xl-4"></div>
            </div>
        )
    }
}
